    "1. How to make a withdrawal?": "1. Jak dokonać wypłaty?",
    "After logging into your account, click \"WITHDRAWALS\" and follow the steps displayed. An account verification is required every time you use a new payment method, but once you have done this you will not need to verify that particular card in order to make a withdrawal again. Please make sure that all your documentations are correct including your ID, bank account and bank card information. If you have any questions and/or problems regarding withdrawals, please contact us by e-mail info@ultrabanc.com or by phone number (+852) 53482546. Documents required for authentication are as follow: 1. Proof of Identity: Driver's license/passport/any other form of government issued identity card with photo. 2. Proof of residence (if proof of identity cannot be provided): Bank or credit card statement, recent utility bill, (water, electricity or telephone bill), municipal tax receipt, etc. 3. If you are using a credit card or debit card, please send a picture of both sides of your bank card, displaying the last four digits of your bank card. We require this additional information as proof of ownership of your credit card. Once your account is verified, click \"WITHDRAWALS\", enter the amount you would like to withdraw, then click \"Send\". We will process all withdrawal requests within three working days.": "Po zalogowaniu się kliknij przycisk \"WYPŁATA\" pod nazwą Twojego konta i postępuj zgodnie z zaleceniami:<br />(A)* Po zleceniu wypłaty po raz pierwszy otrzymasz od nas e-mail zawierający szereg instrukcji. Uprzejmie prosimy o dołączenie do wypłaty wszelkiej wymaganej dokumentacji, składającej się ze:<br />1. Skanu dowodu osobistego lub paszportu,<br />2. Skanu pierwszej strony karty kredytowej, jeżeli dokonałeś przelewu za pomocą tego środka płatniczego lub skanu przelewu, jeżeli dokonałeś płatności e-bankowej (prosimy o PDF będący potwierdzeniem dokonanego e-przelewu, który pobierzesz z historii konta)<br />3. Wypełniony, zeskanowany i podpisany dokument AUDYT OSOBISTY* (ASSESSMENT OF APPROPRIATENESS)<br />4. Jakikolwiek rachunek z Twoim imieniem lub nazwiskiem; skan przelewu, lub opłaty za prąd, wodę, śmieci, telefon itp. zawierający Twoje dane.<br />(B) Po dostarczeniu nam powyższych informacji e-mailem na adres account@ultrabanc.com, prosimy o 1-3 dni na weryfikację dokumentów i danych.<br />(C) Po zakończonej weryfikacji ULTRABANC wyśle zwrócone środki na rachunek, z którego dokonywałeś przelewu i wskazałeś jako właściwy na dokumencie Audyt Osobisty.<br />(D) ULTRABANC ma obowiązek stosować się do instrukcji \"Przeciwdziałania praniu pieniędzy i finansowania terroryzmu\". Zgodnie z wykładnią prawa uprzejmie prosimy o aplikowanie o wypłatę na to samo konto, z którego robiłeś wcześniejszy przelew.<br />Bezwzględnie prosimy także o dokonywanie przelewów z karty, która należy do Ciebie (nie zaś rodziny lub znajomych).<br /><br />* ULTRABANC zdaje sobie sprawę z utrudnionych procedur depozytu i wypłat środków z portfela. <br />Prosimy jednak o zrozumienie, że stosowanie się do procedur Przeciwdziałaniu praniu pieniędzy i finansowaniu terroryzmu jest obowiązkiem każdej regulowanej instytucji finansowej na świecie.<br />Sprawdzamy naszych klientów, żeby Świat stawał się bardziej bezpieczny. <br />Przepraszamy za utrudnienia i prosimy o zrozumienie.",
    "Of course! Even if your withdrawal request is being processed, you can still cancel the withdrawal and return the money to your Ultrabanc account. The withdrawal cancellation option is especially useful when you do not have sufficient funds in your account, but you wish to continue trading. You can simply cancel your withdrawal by contacting us by phone or email.": "Zwykle pobieramy $25 za każdą dyspozycję wypłaty. Opłata pokrywa koszty bankowe związane z międzynarodowym transferem środków. Jeżeli starasz się o wypłatę kwoty wyższej niż $2000, ULTRABANC pokrywa koszty operacji.",
    "4. Can I cancel a withdrawal? How so?": "4. Ile wynosi prowizja za wypłatę środków?",

