    "3. Traders are entitled to obtain an insurance money worth 50% of their total net loss, when only their net loss equals to 90% of their cumulative deposited amount of that first deposit day.":"3. Warunki wypłaty ubezpieczenia:<br/>&nbsp&nbsp&nbsp&nbspa) Ubezpieczona kwota równa jest kwocie depozytu, z którą zgadzasz się na partycypację w akcji POLISA.<br/>&nbsp&nbsp&nbsp&nbspb) Całkowita wielkość straty na otwartych pozycjach w akcji POLISA musi osiągnąć 90% ubezpieczonej kwoty.<br/>&nbsp&nbsp&nbsp&nbspc) Całkowita wielkość transakcji (sumy środków wygranych i utraconych na otwartych pozycjach) musi osiągnąć pięciokrotność ubezpieczonej kwoty.",
    "4. There aren’t any deposits or withdrawals restrictions for traders participating in the Insurance Activity.":"4. Handlowcy, którzy spełniają warunki opisane powyżej, mają prawo do otrzymania odszkodowania w wysokości 50% środków straconych na przegranych pozycjach.",
    "5. Each trader is entitled to receive the insurance money once.":"5. Akcja POLISA jest ważna przez rok od daty pierwszego depozytu.",
