    "IN-THE-MONEY":"BYĆ \"W PIENIĄDZU\", BYĆ PRZY FORSIE",
    "This term means that the market price of the asset is currently trading or has closed and is profitable.":"Termin oznacza, że aktywa aktualnie handlowane lub handel przed chwilą zakończony są zgodne z szacowanym trendem. Wygrywamy.",
    "OUT-OF-THE-MONEY":"BYĆ \"POZA PIENIĄDZEM\"",
