    "AT-THE-MONEY":"BYĆ \"NA PIENIĄDZU\"",
    "Used when the market price of the asset is currently trading at or has closed at the exact target price.":"Aktualnie handlowane aktywa lub zamknięta przed chwilą pozycja zakończyła się na tym samym poziomie, na którym została otwarta. Nie wygrywamy i nie tracimy zainwestowanych środków.",
    "Boundary Option":"OPCJE GRANICZNE, OPCJE BRZEGOWE",
    "The trader decides whether market price is within or beyond a given price range upon trading maturity.":"Handlarz musi zdecydować, czy pozycja zamknie się wewnątrz, czy poza zdefiniowanym obszarem cenowym.",
    "ONE-TOUCH OPTION":"OPCJA ONE TOUCH",
    "The trader decides whether the price of the asset will reach a boundary within a certain time frame, it will be profitable as long as the price reaches the boundary.":"Trader decycyduje się na Opcję, zgodnie z definicją której cena indeksu przynajmniej raz dotknie ustalonej przez Brokera granicy.",
    "Market price is the current price of the asset based on the feed by the data provider.":"Cena rynkowa jest aktualną ceną aktywu dostarczoną przez Brokera na wykresie indeksu na platformie handlowej.",
    "Expiry rate":"CENA NA ZAKOŃCZENIU OPCJI",
