    "Currently Ultrabanc offers two method for withdrawals being:1. Credit card - We operate a \"return to source\" policy which means that credit card withdrawals will have funds only returned back to the same card used to fund the trading account, in 3 to 5 working days.  2. Bank Transfers - all other withdrawal requests are paid through bank transfers in 1 to 3 working  days. * Requests for withdrawals will only be paid after all documents have been received and after they have passed the authentication process.* ULTRABANC platform strictly abides by the Anti-Money Laundering Policy. Please ensure that any payment you make to us is made from a card and account in YOUR name and not from another party. Any remittances from/to third party sources will be rejected.":"W przyszłości dodamy więcej możliwości wypłaty, obecnie jednak wypłata możliwa jest jedynie przez bezpośredni przelew na Twoje konto.<br/><br/>* Wypłata możliwa jest jedynie w momencie zaakceptowania przez nas wszystkich dokumentów.",
    "7. Can I cancel a withdrawal?":"7. Jak mogę anulować dyspozycję WYPŁATY?",
