    "The Dubai Financial Market is a stock exchange located in Dubai, United Arab Emirates. It was founded on March 26, 2000. There are about 57 companies listed (as of August 2007) on DFM, most of them are UAE-based companies and a few dual listings for companies based in other MENA region countries. During 2004 and 2005, there were significant increases in the volume of shares traded and the share prices of many companies. However, towards the end of 2005 and through the first few months of 2006 the bubble burst and share values dropped by around 60% on DFM, along with similar decreases in most other Persian Gulf stock markets. The DFM index includes stocks such as DUBAI ISLAMIC BANK and the EMIRATES TELECOMUNICATION COMPANY.": "The Dubai Financial Market is a stock exchange located in Dubai, United Arab Emirates. It was founded on March 26, 2000. There are about 57 companies listed (as of August 2007) on DFM, most of them are UAE-based companies and a few dual listings for companies based in other MENA region countries. During 2004 and 2005, there were significant increases in the volume of shares traded and the share prices of many companies. However, towards the end of 2005 and through the first few months of 2006 the bubble burst caused share values to drop by around 60% on DFM, along with similar decreases in most other Persian Gulf stock markets. The DFM index includes stocks such as DUBAI ISLAMIC BANK and the EMIRATES TELECOMUNICATION COMPANY.",
